import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';
import { getToken } from './auth';
import '../styles.css';

const ContractList = () => {
  const [contracts, setContracts] = useState([]);
  const [filter, setFilter] = useState('');
  const navigate = useNavigate();

  useEffect(() => {
    const fetchContracts = async () => {
      try {
        const token = getToken();
        if (!token) {
          navigate('/login');
          return;
        }

        const response = await axios.get('http://192.168.1.110:5000/api/contracts', {
          headers: {
            Authorization: `Bearer ${token}`,
            'Content-Type': 'application/json',
          },
          params: { secretariat: filter || undefined },
        });

        console.log('Resposta do backend (contratos):', response.data);
        setContracts(response.data);
      } catch (error) {
        console.error('Erro ao buscar contratos:', error.response?.data || error.message);
        if (error.response?.status === 401) {
          navigate('/login');
        }
      }
    };

    fetchContracts();
  }, [filter, navigate]);

  const handleEdit = (contract) => {
    navigate(`/contracts/edit/${contract.id}`);
  };

  const handleDelete = async (id) => {
    if (window.confirm('Deseja excluir este contrato?')) {
      try {
        const token = getToken();
        if (!token) {
          navigate('/login');
          return;
        }

        await axios.delete(`http://192.168.1.110:5000/api/contracts/${id}`, {
          headers: {
            Authorization: `Bearer ${token}`,
          },
        });

        setContracts(contracts.filter((contract) => contract.id !== id));
        alert('Contrato excluído com sucesso!');
      } catch (error) {
        console.error('Erro ao excluir contrato:', error.response?.data || error.message);
        alert('Erro ao excluir: ' + (error.response?.data?.error || error.message));
        if (error.response?.status === 401) {
          navigate('/login');
        }
      }
    }
  };

  const formatDate = (dateString) => {
    if (!dateString) return 'Data não informada';
    const date = new Date(dateString);
    return isNaN(date.getTime()) ? 'Data inválida' : date.toLocaleDateString('pt-BR');
  };

  return (
    <div className="list-container">
      <div className="filter-container">
        <label>Filtrar por Secretaria:</label>
        <select onChange={(e) => setFilter(e.target.value)} value={filter}>
          <option value="">Todas as Secretarias</option>
          <option value="Administração">Administração</option>
          <option value="Educação">Educação</option>
          <option value="Saúde">Saúde</option>
          <option value="Assistência">Assistência</option>
        </select>
      </div>
      <button onClick={() => navigate('/contracts/new')} className="new-contract-button">
        Novo Contrato
      </button>
      <h2>Lista de Contratos</h2>
      <table className="contract-table">
        <thead>
          <tr>
            <th>Secretaria</th>
            <th>Número</th>
            <th>Data da Assinatura</th>
            <th>Vencimento</th>
            <th>Descrição</th>
            <th>Tipo de Processo</th>
            <th>Status</th>
            <th>Ações</th>
          </tr>
        </thead>
        <tbody>
          {contracts.map((contract) => (
            <tr
              key={contract.id}
              className={
                contract.alert_status === 'red'
                  ? 'alert-red'
                  : contract.alert_status === 'orange'
                  ? 'alert-orange'
                  : ''
              }
            >
              <td>{contract.secretariat || 'Não informado'}</td>
              <td>{contract.contract_number || 'Não informado'}</td>
              <td>{formatDate(contract.start_date)}</td>
              <td>{formatDate(contract.end_date)}</td>
              <td>{contract.description || 'Não informado'}</td>
              <td>{contract.process_type || 'Não informado'}</td>
              <td>{contract.alert_status || 'Não informado'}</td>
              <td>
                <button onClick={() => handleEdit(contract)}>Editar</button>
                <button onClick={() => handleDelete(contract.id)}>Excluir</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default ContractList;
